import React,{Component} from 'react';
import TodoLabel from '../../src/componentes/biceLabel';

class TodoForma2 extends Component{
    constructor(props){
       super(props);
       //console.log(props.valor2)
       this.state={
           dato:props.valor2
        }
    };  

    render(){
         return(
             <div>
                {/* <input placeholder={this.props.valor2}/> */}
                <TodoLabel valor="UF=" nombre="1.3456"/>
                <TodoLabel valor="Pesos=" nombre="1.1456"/>
                <TodoLabel valor="Dolar=" nombre="1.2456"/>

                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Bajo Construccion</h5>
                            <p className="card-text">En Construccion</p>
                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a construccion</button>
                            </form>
                        </div>
                        </div>
                    </div>

                <div className="card text-white bg-primary mb-12" >
                      <form action="/" method="get" >
                          <button className="btn btn-primary"type="submit">Volver</button>
                       </form>                
                </div>

                
             </div>
        )
    }


}
export default TodoForma2;
